import React from 'react';
import './Scroll.css';

const Scroll = (props) => {
	return (
		<div id="scroll" style={{overflowY: 'scroll', border: '0px solid black', height: '500px'}}>
			{props.children}
		</div>
	)
}

export default Scroll;
